  `fund_no` int(11) DEFAULT NULL COMMENT 'tfundacct 主键',
  `earnest_money` decimal(16,3) NOT NULL COMMENT '保证金',
  `sum_money` decimal(16,3) NOT NULL COMMENT '总金额',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `cust_id` (`cust_id`),
  KEY `detail_no` (`investment_account_no`),
  KEY `contract_no` (`contract_no`),
  KEY `fund_no` (`fund_no`),
  CONSTRAINT `contract_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`),
  CONSTRAINT `contract_ibfk_2` FOREIGN KEY (`cust_id`) REFERENCES `cust` (`id`),
