DROP VIEW IF EXISTS `dsh`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `dsh` AS select `q`.`id` AS `id`,sum(`q`.`money`) AS `dsh` from (select substring_index(`v`.`detail`,'-',1) AS `id`,substring_index(`v`.`detail`,'-',-(1)) AS `money` from (select `a1`.`user_id` AS `user_id`,replace(substring_index(`a1`.`detail`,',',`tongniu`.`b`.`id`),concat(substring_index(`a1`.`detail`,',',(`tongniu`.`b`.`id` - 1)),','),'') AS `detail` from (`tongniu`.`b` join (select `x`.`user_id` AS `user_id`,concat(`x`.`detail`,',') AS `detail`,((length(`x`.`detail`) - length(replace(`x`.`detail`,',',''))) + 1) AS `size` from (select `tongniu`.`usercarry`.`id` AS `id`,`tongniu`.`usercarry`.`user_id` AS `user_id`,`tongniu`.`usercarry`.`money` AS `money`,`tongniu`.`usercarry`.`bank_id` AS `bank_id`,`tongniu`.`usercarry`.`bank_card` AS `bank_card`,`tongniu`.`usercarry`.`status` AS `status`,`tongniu`.`usercarry`.`create_time` AS `create_time`,`tongniu`.`usercarry`.`update_time` AS `update_time`,`tongniu`.`usercarry`.`detail` AS `detail` from `tongniu`.`usercarry` where (`tongniu`.`usercarry`.`status` = 0)) `x`) `a1` on((`tongniu`.`b`.`id` <= `a1`.`size`)))) `v`) `q` group by `q`.`id` ;

