CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `showinterest` AS select `c`.`user_id` AS `user_id`,`tongniu`.`user`.`username` AS `username`,`tongniu`.`user`.`realname` AS `realname`,`c`.`sum_current_interest` AS `sum_current_interest`,`c`.`sum_investment_interest` AS `sum_investment_interest`,`c`.`interest_date` AS `interest_date` from (`tongniu`.`user` join ((select ifnull(`a`.`user_id`,`b`.`user_id`) AS `user_id`,ifnull(`a`.`interest_date`,`b`.`interest_date`) AS `interest_date`,ifnull(`a`.`current_interest`,0) AS `sum_current_interest`,ifnull(`b`.`investment_interest`,0) AS `sum_investment_interest` from (((select ifnull(sum(`tongniu`.`current_interest`.`current_interest`),0) AS `current_interest`,`tongniu`.`current_interest`.`user_id` AS `user_id`,`tongniu`.`current_interest`.`interest_date` AS `interest_date` from `tongniu`.`current_interest` group by `tongniu`.`current_interest`.`user_id`,`tongniu`.`current_interest`.`interest_date` order by `tongniu`.`current_interest`.`interest_date` desc)) `a` left join (select ifnull(sum(`tongniu`.`investment_interest`.`investment_interest`),0) AS `investment_interest`,`tongniu`.`investment_interest`.`user_id` AS `user_id`,`tongniu`.`investment_interest`.`interest_date` AS `interest_date` from `tongniu`.`investment_interest` group by `tongniu`.`investment_interest`.`user_id`,`tongniu`.`investment_interest`.`interest_date` order by `tongniu`.`investment_interest`.`interest_date` desc) `b` on(((`a`.`user_id` = `b`.`user_id`) and (`a`.`interest_date` = `b`.`interest_date`))))) union (select ifnull(`a`.`user_id`,`b`.`user_id`) AS `user_id`,ifnull(`a`.`interest_date`,`b`.`interest_date`) AS `ifnull(
						a.interest_date,
						b.interest_date
					)`,ifnull(`a`.`current_interest`,0) AS `sum_current_interest`,ifnull(`b`.`investment_interest`,0) AS `sum_investment_interest` from (((select ifnull(sum(`tongniu`.`investment_interest`.`investment_interest`),0) AS `investment_interest`,`tongniu`.`investment_interest`.`user_id` AS `user_id`,`tongniu`.`investment_interest`.`interest_date` AS `interest_date` from `tongniu`.`investment_interest` group by `tongniu`.`investment_interest`.`user_id`,`tongniu`.`investment_interest`.`interest_date` order by `tongniu`.`investment_interest`.`interest_date` desc)) `b` left join (select ifnull(sum(`tongniu`.`current_interest`.`current_interest`),0) AS `current_interest`,`tongniu`.`current_interest`.`user_id` AS `user_id`,`tongniu`.`current_interest`.`interest_date` AS `interest_date` from `tongniu`.`current_interest` group by `tongniu`.`current_interest`.`user_id`,`tongniu`.`current_interest`.`interest_date` order by `tongniu`.`current_interest`.`interest_date` desc) `a` on(((`a`.`user_id` = `b`.`user_id`) and (`a`.`interest_date` = `b`.`interest_date`)))))) `c`) where (`tongniu`.`user`.`id` = `c`.`user_id`) ;

