CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `showinvestment_account` AS select `a`.`investment_account_no` AS `investment_account_no`,`a`.`username` AS `username`,`a`.`realname` AS `realname`,`a`.`idno` AS `idno`,`a`.`money` AS `money`,`a`.`balance` AS `balance`,`a`.`interest_rate` AS `interest_rate`,`a`.`input_time` AS `input_time`,ifnull(`ytx`.`ytx`,0) AS `ytx`,ifnull(`dsh`.`dsh`,0) AS `dsh`,`a`.`start_date` AS `start_date`,`a`.`end_date` AS `end_date` from ((((select `i`.`id` AS `id`,`i`.`investment_account_no` AS `investment_account_no`,`u`.`username` AS `username`,`u`.`realname` AS `realname`,`u`.`idno` AS `idno`,`i`.`money` AS `money`,`i`.`balance` AS `balance`,`i`.`interest_rate` AS `interest_rate`,`i`.`input_time` AS `input_time`,`i`.`start_date` AS `start_date`,`i`.`end_date` AS `end_date` from (`tongniu`.`user` `u` join `tongniu`.`investment_account` `i`) where (`u`.`id` = `i`.`user_id`))) `a` left join `tongniu`.`ytx` on((`a`.`id` = `ytx`.`id`))) left join `tongniu`.`dsh` on((`a`.`id` = `dsh`.`id`))) ;

