CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `showsquaredata` AS select `t`.`cust_name` AS `cust_name`,`t`.`fund_acct` AS `fund_acct`,`s`.`stock_code` AS `stock_code`,`s`.`stock_name` AS `stock_name`,`s`.`seid_id` AS `seid_id`,`s`.`seid_name` AS `seid_name`,`s`.`sl` AS `sl`,`s`.`now_price` AS `now_price`,`s`.`bz` AS `bz`,`s`.`trade_date` AS `trade_date` from (((select distinct `tongniu`.`tfundacct`.`fund_id` AS `fund_id`,`tongniu`.`tfundacct`.`cust_name` AS `cust_name`,`tongniu`.`tfundacct`.`fund_acct` AS `fund_acct` from `tongniu`.`tfundacct`)) `t` join `tongniu`.`squaredata` `s`) where (`t`.`fund_id` = `s`.`fund_id`) ;

