DROP VIEW IF EXISTS `ytx`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `ytx` AS select `q`.`id` AS `id`,sum(`q`.`money`) AS `ytx` from (select substring_index(`v`.`detail`,'-',1) AS `id`,substring_index(`v`.`detail`,'-',-(1)) AS `money` from (select `a1`.`user_id` AS `user_id`,replace(substring_index(`a1`.`detail`,',',`tongniu`.`b`.`id`),concat(substring_index(`a1`.`detail`,',',(`tongniu`.`b`.`id` - 1)),','),'') AS `detail` from (`tongniu`.`b` join (select `x`.`user_id` AS `user_id`,concat(`x`.`detail`,',') AS `detail`,((length(`x`.`detail`) - length(replace(`x`.`detail`,',',''))) + 1) AS `size` from (select `tongniu`.`usercarry`.`id` AS `id`,`tongniu`.`usercarry`.`user_id` AS `user_id`,`tongniu`.`usercarry`.`money` AS `money`,`tongniu`.`usercarry`.`bank_id` AS `bank_id`,`tongniu`.`usercarry`.`bank_card` AS `bank_card`,`tongniu`.`usercarry`.`status` AS `status`,`tongniu`.`usercarry`.`create_time` AS `create_time`,`tongniu`.`usercarry`.`update_time` AS `update_time`,`tongniu`.`usercarry`.`detail` AS `detail` from `tongniu`.`usercarry` where (`tongniu`.`usercarry`.`status` = 1)) `x`) `a1` on((`tongniu`.`b`.`id` <= `a1`.`size`)))) `v`) `q` group by `q`.`id` ;

-- ----------------------------
-- Procedure structure for assign_1_每日活期利息
-- ----------------------------
DROP PROCEDURE IF EXISTS `assign_1_每日活期利息`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `assign_1_每日活期利息`()
BEGIN
-- 每日活期利息
	`user_id`,
	`investment_account_no`,
	`current_interest`,
	`interest_date`,
	`rate`,
	`fene`
) 
SELECT
	user_id,investment_account_no,TRUNCATE(balance*interest_rate/365,2),date_sub(curdate(), INTERVAL 1 DAY),interest_rate,balance
FROM
	investment_account
WHERE
	balance > 0 and start_date<=date_sub(curdate(), INTERVAL 1 DAY) and end_date>=date_sub(curdate(), INTERVAL 1 DAY);

-- 插入跑批记录
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for assign_2_每日合同利息
-- ----------------------------
DROP PROCEDURE IF EXISTS `assign_2_每日合同利息`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `assign_2_每日合同利息`()
BEGIN
-- 
	`user_id`,
	`contract_no`,
	`investment_account_no`,
	`investment_interest`,
	`input_time`,
	`interest_date`,
	`rate`
) 
SELECT
	user_id,
	contract_no,
	investment_account_no,
	invest_gain,
	CURRENT_TIMESTAMP (),
	date_sub(curdate(), INTERVAL 1 DAY),
	investment_rate
FROM
	contract
WHERE
	iscontinue = 1
AND states = 1

AND end_date <= date_sub(curdate(), INTERVAL 1 DAY);



-- 更新合同累计收益
update contract set sum_gain=sum_gain+TRUNCATE(contract_money*investment_rate/365,2) 
WHERE
	iscontinue = 1
AND states = 1
AND start_date<=date_sub(curdate(), INTERVAL 1 DAY)
AND end_date >= date_sub(curdate(), INTERVAL 1 DAY);

-- 插入跑批记录
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for assign_3_每日合同本金
-- ----------------------------
DROP PROCEDURE IF EXISTS `assign_3_每日合同本金`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `assign_3_每日合同本金`()
BEGIN
-- 当天结清合同本金返回投资账户investment_account,tfundacct扣款 并插入流水记录
declare v_investment_account_no VARCHAR(255);
declare v_contract_money DECIMAL(18,3);
declare v_fund_id int;
declare v_contract_no VARCHAR(255);
DECLARE  no_more_record INT DEFAULT 0;
declare contract_cursor  CURSOR FOR 
select investment_account_no,contract_money,fund_id,contract_no
FROM
	contract
WHERE
	iscontinue = 1
AND states = 1
AND end_date <= date_sub(curdate(), INTERVAL 1 DAY);
 DECLARE  CONTINUE HANDLER FOR NOT FOUND  SET  no_more_record = 1;
open contract_cursor;
FETCH contract_cursor into v_investment_account_no,v_contract_money,v_fund_id,v_contract_no;
while no_more_record != 1 do
update investment_account set balance=balance+v_contract_money where investment_account_no=v_investment_account_no;
		`deal_no`,
		`user_id`,
		`money`,
		`flag`
	)
VALUES
	(
		unix_timestamp() * 1000 + floor(rand() * 1000),
		(select user_id from investment_account where investment_account_no=v_investment_account_no),
		v_contract_money,
		111003
	);

call 资金回款资金账户扣款操作(v_fund_id,v_contract_money,v_contract_no);
FETCH contract_cursor into v_investment_account_no,v_contract_money,v_fund_id,v_contract_no;
end while;
close contract_cursor;

-- 插入跑批记录
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for assign_4_每日账户更新
-- ----------------------------
DROP PROCEDURE IF EXISTS `assign_4_每日账户更新`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `assign_4_每日账户更新`()
BEGIN
-- 更新用户账户用户 汇总当天的活期利息+当天已结合同利息
-- 注意：1、活期利息每天插入 current_interest 
				-- （assign_1_每日活期利息）
-- 			 2、合同结清当天利息插入investment_interest
          -- （assign_2_每日合同利息)
            -- 本金回到原来的资金账户investment_account (assign_3_每日合同本金)
DECLARE no_more_record INT DEFAULT 0;
DECLARE V_USER_ID INT (11);
DECLARE V_SUM DECIMAL (16, 2);
DECLARE account_cursor CURSOR FOR SELECT
	`user_id`
FROM
	`account`;

DECLARE CONTINUE HANDLER FOR NOT FOUND
SET no_more_record = 1;

OPEN account_cursor;
FETCH account_cursor INTO V_USER_ID;
WHILE no_more_record != 1 DO
	
	SELECT
		(
			
			(
				SELECT
					ifnull(sum(current_interest), 0)
				FROM
					current_interest
				WHERE
					user_id = v_user_id
				AND interest_date = date_sub(curdate(), INTERVAL 1 DAY)
			)-- 当天活期利息和 
			+ 
			-- 当天已结合同利息和
			(
				SELECT
					ifnull(sum(investment_interest), 0)
				FROM
					investment_interest i,contract c
				WHERE
					i.user_id = v_user_id
				AND interest_date = date_sub(curdate(), INTERVAL 1 DAY)
        and i.contract_no=c.contract_no
				and c.states=1
			)
		) INTO v_sum;

-- 更新账户 总资产和总收益
UPDATE account
SET sum_money = sum_money + v_sum,
 gain = gain + v_sum
WHERE
	user_id = v_user_id;

FETCH account_cursor INTO V_USER_ID;

END
WHILE;
CLOSE account_cursor;

-- 插入跑批记录
END
;;
DELIMITER ;

