-- ----------------------------
-- Procedure structure for assign_6_检查结束合同是否扣除资金账户
-- ----------------------------
DROP PROCEDURE IF EXISTS `assign_6_检查结束合同是否扣除资金账户`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `assign_6_检查结束合同是否扣除资金账户`()
BEGIN
-- 合同状态更新后，判断如果合同结束，该合同的借款人账户还有钱就继续跑 一次扣款 
declare v_contract_money DECIMAL(18,3);
declare v_investment_account_no VARCHAR(255);
declare v_fund_id int;
declare v_contract_no VARCHAR(255);
DECLARE  no_more_record INT DEFAULT 0;
declare contract_cursor  CURSOR FOR 
SELECT
	c.investment_account_no,c.contract_money,c.fund_id,c.contract_no
FROM
	contract c,
	tfundacct t
WHERE
	c.states = 3
AND end_date <= date_sub(curdate(), INTERVAL 1 DAY)
and c.fund_id=t.fund_id and t.contract_no=c.contract_no
and c.contract_money=t.contract_money
;
 DECLARE  CONTINUE HANDLER FOR NOT FOUND  SET  no_more_record = 1;
open contract_cursor;
FETCH contract_cursor into v_investment_account_no,v_contract_money,v_fund_id,v_contract_no;
while no_more_record != 1 do

update investment_account set balance=balance+v_contract_money where investment_account_no=v_investment_account_no;
		`deal_no`,
		`user_id`,
		`money`,
		`flag`
	)
VALUES
	(
		unix_timestamp() * 1000 + floor(rand() * 1000),
		(select user_id from investment_account where investment_account_no=v_investment_account_no),
		v_contract_money,
		111003
	);

call 资金回款资金账户扣款操作(v_fund_id,v_contract_money,v_contract_no);
FETCH contract_cursor into v_investment_account_no,v_contract_money,v_fund_id,v_contract_no;
end while;
close contract_cursor;

-- 插入跑批记录
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for assign_7_插入每日年化
-- ----------------------------
DROP PROCEDURE IF EXISTS `assign_7_插入每日年化`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `assign_7_插入每日年化`()
BEGIN
	#每天定时插入当日年化
 SELECT
	user_id,
	round(
		ifnull(
			sum(balance * interest_rate) / sum(balance),
			0
		),
		3
	),
date_sub(curdate(), INTERVAL 1 DAY)
FROM
	investment_account
GROUP BY
	user_id;

-- 插入跑批记录
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for assign_每日_00_00_30
-- ----------------------------
DROP PROCEDURE IF EXISTS `assign_每日_00_00_30`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `assign_每日_00_00_30`()
BEGIN
call assign_1_每日活期利息;
call assign_2_每日合同利息;
call assign_3_每日合同本金;
call assign_4_每日账户更新;
call assign_5_每日合同状态;
call assign_6_检查结束合同是否扣除资金账户;
call assign_7_插入每日年化;
end
;;
