-- ----------------------------
-- Procedure structure for 合同回款利息回账户插流水
-- ----------------------------
DROP PROCEDURE IF EXISTS `合同回款利息回账户插流水`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `合同回款利息回账户插流水`(IN v_contract_no VARCHAR (255))
BEGIN
DECLARE v_money DECIMAL(16,3);
DECLARE v_contract_money DECIMAL(16,3);
DECLARE v_rate DECIMAL(16,3);
DECLARE v_user_id int;
DECLARE v_investment_account_no varchar(255);

update contract set sum_gain=sum_gain+TRUNCATE(contract_money*investment_rate/365,2) 	WHERE
		contract_no = v_contract_no and start_date<=CURRENT_TIMESTAMP;

	SELECT
		
			sum_gain,user_id,investment_account_no,investment_rate,contract_money
into v_money,v_user_id,v_investment_account_no,v_rate,v_contract_money
	FROM
		contract
	WHERE
		contract_no = v_contract_no;





if v_money>0 then
UPDATE account
SET sum_money = sum_money+v_money,
 gain = gain +v_money
WHERE
	user_id = v_user_id;



values(v_user_id,v_contract_no,v_investment_account_no,v_money,CURDATE(),v_rate);
end if;
		`deal_no`,
		`user_id`,
		`money`,
		`flag`
	)
values( unix_timestamp() * 1000 + floor(rand() * 1000),
v_user_id,v_contract_money,111003);
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for 提现关闭返款
-- ----------------------------
DROP PROCEDURE IF EXISTS `提现关闭返款`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `提现关闭返款`(in v_id int(11))
BEGIN
	declare v_num int(11);
  declare v_money DECIMAL(16,2);
declare v_str VARCHAR(255);
declare v_investment_account_id int(11);

SELECT LENGTH(detail) - LENGTH(REPLACE(detail, ',', '')) + 1 into v_num from usercarry  where id=v_id;
while v_num !=0 DO
  select substring_index(substring_index(detail,',', v_num), ',', -1) into v_str from usercarry  where id=v_id;
  set v_investment_account_id=substring_index(v_str,'-',1);
set v_money=substring_index(v_str,'-',-1);
update investment_account set balance=balance+v_money where id=v_investment_account_id;
set v_num=v_num-1;
end while;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for 提现扣款先进先出
-- ----------------------------
DROP PROCEDURE IF EXISTS `提现扣款先进先出`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `提现扣款先进先出`(IN v_user_id INT,
	IN money DECIMAL (16, 2),out v_out varchar(5000))
BEGIN
DECLARE no_more_record INT DEFAULT 0;
DECLARE v_balance DECIMAL (16, 2);
DECLARE v_id INT (11);
DECLARE v_bal DECIMAL (16, 2) DEFAULT money;
DECLARE investment_account_CURSOR CURSOR FOR SELECT
	`balance`,
	`id`
FROM
	investment_account
WHERE
	user_id = v_user_id
ORDER BY
	input_time ASC;
DECLARE CONTINUE HANDLER FOR NOT FOUND
SET no_more_record = 1;
OPEN investment_account_CURSOR;
SET V_OUT='';
 /* 循环开始 */  
    myLoop: LOOP  
      FETCH investment_account_CURSOR INTO v_balance,
 v_id;
       IF v_balance < v_bal  THEN
if v_balance<=0 then ITERATE myLoop; end if;
	UPDATE investment_account
SET balance = 0 where id=v_id;
SET v_bal = v_bal - v_balance;
set v_out=concat(v_out,v_id,'-',v_balance);

ELSE

	UPDATE investment_account
SET balance = balance - v_bal where id=v_id;
set v_out=concat(v_out,v_id,'-',v_bal);

SET v_bal = 0;


END
IF;


IF v_bal = 0 THEN

LEAVE myLoop;
ELSE
set v_out=concat(v_out,',');

END
IF;
if no_more_record=1 THEN
LEAVE myLoop;
end if;

    /* 循环结束 */  
    end loop myLoop;  

update account set sum_money=sum_money-money where user_id=v_user_id;


END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for 购买股票资金账户扣款
-- ----------------------------
DROP PROCEDURE IF EXISTS `购买股票资金账户扣款`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `购买股票资金账户扣款`(IN v_fund_id INT,
	IN money DECIMAL (16, 2))
BEGIN
DECLARE v_fund_balance DECIMAL (16, 2);
DECLARE v_fund_no int;
DECLARE v_bal DECIMAL (16, 2) DEFAULT money;
DECLARE tfundacct_cursor CURSOR FOR SELECT
	`fund_no`,
`fund_balance`
FROM
	tfundacct
WHERE
	fund_id=v_fund_id;

OPEN tfundacct_cursor;

 /* 循环开始 */  
    myLoop: LOOP  
      FETCH tfundacct_cursor INTO v_fund_no,
 v_fund_balance;
       IF v_fund_balance < v_bal  THEN
if v_fund_balance<=0 then ITERATE myLoop; end if;
	UPDATE tfundacct
SET fund_balance = 0 where fund_no=v_fund_no;
SET v_bal = v_bal - v_fund_balance;
ELSE

	UPDATE tfundacct
SET fund_balance = fund_balance - v_bal where fund_no=v_fund_no;
SET v_bal = 0;
END
IF;
IF v_bal = 0 THEN
LEAVE myLoop;
END
IF;

    /* 循环结束 */  
    end loop myLoop;  




END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for 资金回款撤销操作
-- ----------------------------
DROP PROCEDURE IF EXISTS `资金回款撤销操作`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `资金回款撤销操作`(IN v_fund_id INT,
	IN money DECIMAL (16, 2),
	IN v_contract_no VARCHAR (255))
BEGIN

DECLARE v_fund_no INT;

set v_fund_no=(select min(fund_no) from tfundacct where fund_id=v_fund_id);

update tfundacct set fund_balance=fund_balance+money where fund_no=v_fund_no;


update tfundacct set contract_money=money where fund_id=v_fund_id and contract_no=v_contract_no;


END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for 资金回款资金账户扣款操作
-- ----------------------------
DROP PROCEDURE IF EXISTS `资金回款资金账户扣款操作`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `资金回款资金账户扣款操作`(IN v_fund_id INT,
	IN money DECIMAL (18, 3),
	IN v_contract_no VARCHAR (255))
BEGIN

DECLARE v_fund_balance DECIMAL (16, 2);
DECLARE v_fund_no INT;
DECLARE v_bal DECIMAL (16, 2) DEFAULT money;


DECLARE tfundacct_cursor CURSOR FOR SELECT
	`fund_no`,
	`fund_balance`
FROM
	tfundacct
WHERE
	fund_id = v_fund_id ;


-- set v_bal=v_bal-(select fund_balance from tfundacct where contract_no=v_contract_no);
update tfundacct set  contract_money=0 where contract_no=v_contract_no;
if v_bal>0 then 


OPEN tfundacct_cursor;

/* 循环开始 */
myLoop :
LOOP
	FETCH tfundacct_cursor INTO v_fund_no,
	v_fund_balance;
-- SELECT concat("v_bal",v_bal);
-- SELECT concat("v_fund_balance",v_fund_balance);

IF v_fund_balance<=v_bal THEN
set v_bal=v_bal-v_fund_balance;
update tfundacct set fund_balance=0 where fund_no=v_fund_no;	
else 

update tfundacct set fund_balance=v_fund_balance-v_bal where fund_no=v_fund_no;
 set v_bal=0;
end if;
IF v_bal = 0 THEN
	LEAVE myLoop;
end if;
/* 循环结束 */
END
LOOP
	myLoop;


end if;
END
;;
