DROP TRIGGER IF EXISTS `添加合同记录_扣除investment_account里对应编号的钱`;
DELIMITER ;;
CREATE TRIGGER `添加合同记录_扣除investment_account里对应编号的钱` AFTER INSERT ON `contract` FOR EACH ROW BEGIN
	UPDATE `investment_account`
SET balance = balance - new.contract_money
WHERE
	investment_account_no = new.investment_account_no;

END
