DELIMITER ;
DROP TRIGGER IF EXISTS `操作员_进行股票买入时_进行资金账户扣款_已经持有股票汇总的操作`;
DELIMITER ;;
CREATE TRIGGER `操作员_进行股票买入时_进行资金账户扣款_已经持有股票汇总的操作` AFTER INSERT ON `squaredata` FOR EACH ROW BEGIN

SET @cust_id = (
	SELECT
		DISTINCT cust_id
	FROM
		tfundacct
	WHERE
		fund_id = new.fund_id
);



SET @count = (
	SELECT
		count(0)
	FROM
		stockamount
	WHERE
		cust_id = @cust_id
	AND stock_code = new.stock_code
	AND fund_id = new.fund_id
);


SET @fund_acct = (
	SELECT
		DISTINCT fund_acct
	FROM
		tfundacct
	WHERE
		fund_id = new.fund_id
);

SET @fund_no = (
	SELECT
		min(fund_no)
	FROM
		tfundacct
	WHERE
		fund_id = new.fund_id
);


IF new.type = 113200 THEN

IF @count = 0 THEN
		cust_id,
		stock_code,
		stock_name,
		balance,
		seid_id,
		seid_name,
		fund_id,
		fund_acct
	)
VALUES
	(
		@cust_id,
		new.stock_code,
		new.stock_name ,
		new.sl,
		new.seid_id,
		new.seid_name,
		new.fund_id ,@fund_acct
	);


ELSE
	UPDATE stockamount
SET balance = balance + new.sl
WHERE
	cust_id =@cust_id
AND stock_code = new.stock_code;


END
IF;

call 购买股票资金账户扣款(new.fund_id,new.sl*new.now_price);


ELSEIF new.type = 113298 THEN
	UPDATE stockamount
SET balance = balance - new.sl
WHERE
	cust_id =@cust_id
AND stock_code = new.stock_code;

UPDATE tfundacct
SET fund_balance = fund_balance + new.sl * new.now_price
WHERE
	fund_no = @fund_no;
ELSEIF new.type = 113208 THEN
UPDATE tfundacct
SET fund_balance = fund_balance + new.occurrence_fund
WHERE
	fund_no = @fund_no;

END
IF;


END
;;
